export const Planet: React.FC<{}> = () => {
  const frame = useCurrentFrame();
  const { fps } = useVideoConfig();
  const noise = noise2D("seed", frame / 10, 1) * 10;

  const spr = spring({
    frame,
    fps,
    config: {
      damping: 14,
    },
    durationInFrames: 20,
  });

  const spr2 = spring({
    frame,
    fps,
    delay: 20,
  });

  return (
    <AbsoluteFill
      style={{
        justifyContent: "center",
        alignItems: "center",
        justifyItems: "center",
      }}
    >
      <div
        style={{
          position: "absolute",
          transform: `scale(${1 - spr * 0.2 + spr2 * 0.2}) rotate(${noise}deg)`,
        }}
      >
        <JavaPlanet />
      </div>
    </AbsoluteFill>
  );
};
